import './App.css';
import Card from './Card';
import Menu from './Menu';

export default function App() {
  const {dice, setDice} = useState(0);
  function rollDice () {
    const newRoll = Math.floor(Math.random() * 6);

    setDice(newRoll);
    
    return newRoll;
  }


  return (
    <div>
      Dice game
      <Menu />
      <Card />
    </div>
  );
}
